import React, {Component} from "react";
import {MDBBox} from "mdbreact";
import { MDBInput } from "mdbreact";

const InputPage = () => {
  return (
    <MDBInput size="sm" background value="User"  label="Enter your name" style={{margin:"0px",color:"black"}} />
  );
}

class BoxPage extends Component{
    constructor(props){
        super(props)
        this.state ={
            name:"User"
        }

    }
    render(){
        return(
            <MDBBox className="customBox">
                 <InputPage />
              <div className="welcomeMessage">  Welcome {this.state.name} </div>
             </MDBBox>
        );
    }
}




export default  BoxPage;
